import{_ as n}from"./plugin-vue_export-helper-c27b6911.js";import{r as t,o as r,c as s,a,b as c,d as e,e as i}from"./app-e7fce849.js";const l={},d=e("p",null,"Nengo Brain Maker 是一个用于构建、测试和部署神经网络的 Python 包。",-1),m=e("h2",{id:"简介",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#简介","aria-hidden":"true"},"#"),i(" 简介")],-1),_=e("p",null,"Nengo 是一个用于构建和模拟大规模神经认知系统（neural cognitive systems）的开源软件平台和编程语言。它基于生物神经网络的设计理念，旨在帮助用户更加高效地构建和实现生物神经网络模型，并进行仿真和分析。Nengo 的设计思想是通过构建一系列神经元集群来实现复杂的计算，每个神经元集群都相当于大脑中的一个神经元或神经元群，这些神经元集群可以通过突触连接彼此传递信息和执行计算任务。与其他神经网络模拟器相比，Nengo 具有可扩展、高效、灵活和易于调试等特点。Nengo 能够应用于多种领域，如视觉处理、语言学习、孪生神经网络等，为研究人员和开发人员提供了强大的工具和平台。",-1);function h(p,g){const o=t("Presentation");return r(),s("div",null,[d,a(" more "),m,_,c(o,{id:"presentation-10",code:"",theme:"auto"})])}const v=n(l,[["render",h],["__file","nengo.html.vue"]]);export{v as default};
